import { ToastContainer, toast } from "react-toastify";
import{Link} from "react-router-dom";
import "react-toastify/dist/ReactToastify.css";

function TSolutions() {
    return (
        <div class=" h-full w-full">
            <h2 className='mt-6 text-center text-2xl font-extrabold text-gray-900'> TSolutions</h2>

            <h4 className='mt-4 p-10 text-left  text-gray-700'>
                Somos una empresa colombiana dedicada a la venta de productos tecnológicos de Alta Gama al por mayor y al mejor precio, somos importadores directos trayéndote lo último en productos tecnológicos. /media/login.479bbcf7.svg
            </h4>
           

        </div>
    );
}

export default TSolutions
